//Q3: 
//Load Q3 table from mongo
val readConfig = ReadConfig(Map("uri" -> "mongodb://root:root@3.87.252.151:27017", "database" -> "GDELT", "collection" -> "Q3-2020"))
val df_Q3 = spark.read.mongo(readConfig) 

//Could see the table but quite longer than on the two others dataframe
//z.show(spark.sql("""SELECT * FROM q3 LIMIT 10"""))

//We observed that the month column we saved in Mongo was including an error, however we are able to recover the month information through the record Id as done below:
val df_q3_corrected=df_Q3.select(col("*"), substring(col("GKGRECORDID"), 5, 2).as("month_corrected"))
df_q3_corrected.createOrReplaceTempView("q3")

// Create the join between the 3 tables on the record Id
//This way we will be able to obtain for the source we filtered before, all the triplet person/themes/location with their average tone and number of articles grouped by month
val join_ssrc=spark.sql("""SELECT themes, persons, locations, COUNT(q3_persons_src.GKGRECORDID) AS Nb_articles, q3_persons_src.month_corrected, AVG(q3_persons_src.avg_tone) AS Avg_tone FROM q3_persons_src, q3_themes_src, q3_locations_src WHERE q3_persons_src.GKGRECORDID=q3_themes_src.GKGRECORDID AND q3_locations_src.GKGRECORDID=q3_themes_src.GKGRECORDID AND q3_persons_src.GKGRECORDID=q3_locations_src.GKGRECORDID GROUP BY themes, persons, locations, q3_persons_src.month_corrected""")

